import React from 'react';
import { FaBell, FaUserCircle, FaSignOutAlt } from 'react-icons/fa';
import './Navbar.css';

export default function Navbar({ user, onLogout }) {
  return (
    <nav className="navbar-fixed">
      <div className="navbar-left">
        {/* Placeholder for logo or extra features */}
      </div>
      <div className="navbar-right">
        <button className="navbar-icon-btn" title="Notifications">
          <FaBell />
        </button>
        <button className="navbar-icon-btn" title="Profile">
          {user?.photo ? (
            <img src={user.photo} alt="Profile" className="navbar-profile-img" />
          ) : (
            <FaUserCircle />
          )}
        </button>
        <button className="navbar-icon-btn" title="Logout" onClick={onLogout}>
          <FaSignOutAlt />
        </button>
      </div>
    </nav>
  );
}
